import React from "react";
import Toolbar from "../Navigation/Toolbar/Toolbar";
import SideDrawer from "../Navigation/SideDrawer/SideDrawer";

import "./Layout.css";

const Layout = (props) => {
  return (
    <>
      <Toolbar />
      <main className="Content">{props.children}</main>
    </>
  );
};

export default Layout;
